script: |
  super -f text -I q6535.spq | sort > q6535.out

inputs:
  - name: q6535.spq
    data: |
      SELECT - col1 + - - col2 + - col2 * col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 49 / + + col2 IN ( col1 + col0 + + + col0 / - CAST ( + CAST ( NULL AS INTEGER ) AS INTEGER ) );
  - name: tab1

outputs:
  - name: q6535.out
    data: |
